import CardEquipoEjemplo from '../CardEquipoEjemplo/CardEquipoEjemplo'
function EquipoEjemplo(props) {
    const colorPrimario=props.datos.colorPrimario;
    return (
        <section className="equipo rojo" style={{backgroundColor:colorPrimario}}>
            <h3>{props.datos.titulo}</h3>
            <CardEquipoEjemplo/>
        </section>
    )
}
export default EquipoEjemplo
